    public class Solution
    {
        public int LengthOfLongestSubstring(string s)
        {
            int max = 0;
            int start = 0;
            int current = 0;
            int[] chars = new int[128];
            char c;
            for (int i = 0; i < chars.Length; i++)
            {
                chars[i] = -1;
            }
            
            for (int i = 0; i < s.Length;)
            {
                c = s[i];
                if (chars[c] != -1)
                {
                    start = Math.Max(start,chars[c]);
                }
                i++;
                current = i-start;
                chars[c] = i;
                max = Math.Max(max, current);
            }

            max = Math.Max(max, current);
            return max;
        }
    }
